function LeChat() {
  // Le Chat fait une d\xE9claration
  console.log("Je pense, donc je suis...");

  // Pause pour effet dramatique
  setTimeout(function() {
    console.log("...mais si je dors, suis-je toujours?");
  }, 3000);

  // Le Chat conclut avec sagesse
  setTimeout(function() {
    console.log("Peut-\xEAtre que je suis, mais je ne suis pas s\xFBr.");
  }, 6000);
}

